:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Herbert William and MASON, Bertha Louisa Gertrude
  JWILLIAMS, Herbert Meyric and PLUMMER, June
  JWILLIAMS, Megan and PAYTON, Dermot Hurlston
  03> PAYTON, Lucy Jane
  b 10.10.1973
  Lucy b. at Masterton. She was educated at Fernridge School and St Matthew's Collegiate School in
  Masterton then graduated BA and DipTchng from Victoria University and Wellington College of
  Education. She taught at Eastern Hutt School where she gained her registration. In 1991 Lucy
  travelled to Nepal with the Youth to Everest Programme. Currently she is living in London doing
  relief teaching and travelling wherever possible. Her interests include reading, embroidery,
  mountain biking, tramping and computers.
  06>' WILLIAMS, Agnes Maria m on 10.12.1889 to GARDINER, Allen Francis
  b 21.07.1862 d 15.08.1921
  b 15.02.1862 d 28.05.1912
  Agnes b. at Waerenga-a-hika and d. at Napier, Allen, slo Allen Weare Gardiner and Rose
  Lloyd, b. in England and d. at Oxford, England.
  Allen joined the Royal Navy and travelled around the world as a midshipman. He was
  invalided out and went to Pembroke College, Cambridge. Again, on account of
  ill-health, he came out to New Zealand to join the family who had migrated there. He
  was ordained a Deacon on 03 February 1889 by Edward Stuart, Bishop of Waiapu, and a
  Priest on 09 March, 1890. He was Curate of Gisborne (country districts), 1889-93; Vicar of Waipawa, 1893-98;
  Locum Tenens at Marton, 1898-99; and Vicar of Havelock North, 1900-11,
  01> GARDINER, Allen William
  b 15.10.1890 d ** **.1913
  Allen b. at Gisborne. He was head shepherd on "Te Aute" Station, Hawkes Bay where he died of typhoid. He is
  bd, at Pukehou.
  02> GARDINER, George Falkland m on 04.03.1926 to HICKS, Gladys
  b 20.05.1892 d 20.02.1953
  b 29.10.1894 d **.10.1978
  Falkland b. at Gisborne and d. at Napier. Gladys b, at Ipswich, England and d. at Napier. Gladys has a
  daughter, Audrey Jane Bernau (b. 19.11.1916 in British Colombia, Canada).
  Falkland was a sheepfarmer, served in France in ww1 and was a public accountant in Napier until his death.
  He was secretary of the Henry and William Williams Memorial Trust for 25 years.
  01> GARDINER, Jill m on 11.12.1954 to DAVIES, Michael de la Cour
  b 26.05.1928
  b 25.08.1923
  Jill b. and m, at Napier, Michael, s/o Henry Cornwall Davies and Bertha Grace Matthews. Address: 17
  Meeanee Road, Taradale.
  Jill is a registered nurse, enjoys embroidery and golf and is a Trustee of the Henry and William
  Williams Memorial Trust. Michael is a retired medical practitioner with interests in video and
  distillation technology.
  01> DAVIES, Peter Cornwall m on 28.02.1987 to YOUNG, Susan Gaye
  b 18.04.1956
  b 08.11.1959
  Peter b. at Wellington and m. at Christchurch. Susan, d/o Eric Wilson Young and Peggy Ethel
  Gluestein. Address: 3 Brighton Road, Whangarei.
  Peter is a commercial pilot of fixed wing aircraft and helicopters and is working for the Northern
  Emergency Services Trust on the rescue helicopter in Whangarei and Auckland, Sue is a secondary
  school and piano teacher.
  01> DAVIES, Simon James
  b 20.04.1992
  Simon b. at Aberdeen, Scotland.
